import React from 'react';
import {
    SafeAreaView,
    View,
    Text, 
    StyleSheet, 
    TouchableOpacity,
    Image, 
    flatList
} from 'react-native';

import { icons, COLORS, images, SIZES, FONTS } from '../constants';

const Home = () => {
    function renderHeader() {
        return (
            <View style={{flexDirection: 'row', height: 50}}>
                <TouchableOpacity
                    style={{
                        width: 50, 
                        paddingLeft: SIZES.padding * 2,
                        justifyContent: 'center'
                    }}
                >
                    <Image
                        source={icons.nearby}
                        resizeMode='contain'
                        style={{
                            width: 30,
                            height: 30
                        }}
                    ></Image>
                </TouchableOpacity>
                <View style={{flex: 1, alingItems: 'center', justifyContent: 'center'}}>
                    <View
                        style={{
                            width: '70%',
                            height: '100%', 
                            backgroundColor: COLORS.lightGray3,
                            alignItems: 'center',
                            justifyContent: 'center',
                            borderRadius: SIZES.radius
                        }}
                    >
                        <Text style={{...FONTS.h3}}>Location</Text>
                    </View>
                </View>

            </View>

        )
    }

    return (
        <SafeAreaView style={styles.container}>
            {renderHeader()}
        </SafeAreaView>
    )
}

export default Home;
